#include <unordered_map>
#include <fstream>

using namespace std;

ifstream in("cod.in");
ofstream out("cod.out");

int main() {
  int n;
  in >> n;
  unordered_map<int, int> freq;
  int nr;
  for (int i = 0; i < n; ++i) {
    in >> nr;
    freq[nr]++;
  }

  string cod;
  for (auto &p : freq) {
    if (p.second % 2 == 1) {
      cod += to_string(p.first);
    }
  }

  out << cod;
  return 0;
}
